import { container, title } from "assets/jss/material-kit-react.jsx";

const ContactStyle = createMuiTheme({
  overrides: {
    MuiFormControl : {
      root: {
        width: "100%"
      }
    }
  },
  container: {
    zInde: "12",
    color: "#ffffff",
    ...container
  },
  section: {
    padding: "70px 0"
  },
  title: {
    ...title,
    marginBottom: "50px",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none",
    textAlign: "center"
  },
  description: {
    color: "#999",
    textAlign: "center"
  },
  textCenter: {
    textAlign: "center"
  },
  textArea: {
    marginRight: "15px",
    marginLeft: "15px"
  },
  message: {
    width: "100%"
  }
});

export default ContactStyle;
